import React from 'react';
import './App.css';
import {ItemViewer} from './ItemViewer'
import {Home} from './Home'
import {Account} from './Account'


import {BrowserRouter,
		Routes,
		Route,
		Link
		} from "react-router-dom";

export class App extends React.Component {
	constructor(){
		super();


	}


	render(){


	return (
		<BrowserRouter>
		<div>
			<div className="top-cont">
				<header>
				<div class="home-button-cont">

					<Link class="home-button" to="/shop" onClick={this.forceUpdate}>
						WebShop
					</Link>
				</div>

					<nav>
						<ul class="navigation" id="nav">
							<li>
								<a class="nav-button">Sign in</a>
								<a class="nav-button">Sign up</a>
								<a class="nav-button">Shopping Cart</a>
							</li>
						</ul>
					</nav>

				</header>



			</div>

			<div class='main-cont'>
				<Routes>
					<Route path="/shop/*" element={<Home search="http://localhost:8000/api/items/"/>} />

				</Routes>

			</div>


		</div>
		</BrowserRouter>
	);
	}
}

export default App;
